import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // Attempt XSS payload in the search input
    const xssPayload = `<img src=x onerror=alert('XSS')>`;
    await page.fill('#searchInput', xssPayload);

    // Screenshot after filling input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_xss_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_xss_input.png'));

    // Try to submit the search (search button may be empty, try click by class or fallback to Enter)
    let searchBtnClicked = false;
    try {
      // Try first visible search button
      const btns = await page.$$('.search-btn');
      for (const btn of btns) {
        if (await btn.isVisible()) {
          await btn.click();
          searchBtnClicked = true;
          break;
        }
      }
    } catch (e) {
      // Ignore, fallback to Enter
    }
    if (!searchBtnClicked) {
      // Fallback: press Enter in the input
      await page.focus('#searchInput');
      await page.keyboard.press('Enter');
    }

    // Wait for possible search results or DOM update
    await page.waitForTimeout(800);

    // Screenshot after search submission
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_submit.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_submit.png'));

    // Extract possible XSS evidence: check if our payload appears in the DOM as HTML (not text)
    // Try to find an <img> with src=x (our payload)
    const xssImg = await page.$('img[src="x"]');
    let xssEvidence = false;
    if (xssImg) {
      xssEvidence = true;
    } else {
      // As fallback, check if the payload string is rendered as HTML anywhere
      const htmlContent = await page.content();
      xssEvidence = htmlContent.includes('<img src=x onerror=alert(\'XSS\')>');
    }

    return {
      success: true,
      action: "Attempted XSS via search input and submitted the payload",
      extractedData: {
        xssPayload,
        xssEvidence
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
